MATCH (d:Drug)-[:DrugHasIndication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Ropinirole')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (d:Drug)
WHERE toLower(d.displayName) = toLower('Ribavirin')
RETURN d.primaryDomainId AS drugId, d.displayName AS drugName, d.casNumber AS casNumber;

MATCH (d:Drug)-[:DrugHasContraindication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Paroxetine')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (g:Gene)-[r:GeneAssociatedWithDisorder]->(dis:Disorder {primaryDomainId:'mondo.0016419'})
WHERE (r.scoreOpenTargets IS NULL OR r.scoreOpenTargets > 0.3)
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (dis:Disorder)
WHERE toLower(dis.displayName) = toLower('cystic fibrosis')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (sub:Disorder)-[:DisorderIsSubtypeOfDisorder]->(sup:Disorder)
WHERE toLower(sup.displayName) = toLower('neoplasm')
RETURN sub.primaryDomainId AS subId, sub.displayName AS subName;

MATCH (v:GenomicVariant)-[:VariantAffectsGene]->(g:Gene {primaryDomainId:'entrez.672'})
WHERE v.variantType = 'SNV'
RETURN v.primaryDomainId AS variantId, v.displayName AS variantName, v.position AS position, v.chromosome AS chromosome, v.referenceSequence AS ref, v.alternativeSequence AS alt;

MATCH (v:GenomicVariant)-[:VariantAssociatedWithDisorder]->(dis:Disorder)
WHERE v.chromosome = 'X'
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (v:GenomicVariant)-[:VariantAssociatedWithDisorder]->(d:Disorder)-[:DisorderHasPhenotype]->(p:Phenotype)
WHERE p.primaryDomainId IN ['hpo.0001250','hpo.0007359','hpo.0011145','hpo.0032891','hpo.0032898','hpo.0001249','hpo.0010864','hpo.0002187','hpo.0006887','hpo.0001256']
RETURN DISTINCT v.primaryDomainId AS variantId, v.displayName AS variantName, p.primaryDomainId AS phenotypeId, p.displayName AS phenotypeName;

MATCH (dis1:Disorder {primaryDomainId:'mondo.0850097'})-[:DisorderHasPhenotype]->(ph:Phenotype)<-[:DisorderHasPhenotype]-(dis2:Disorder)
WHERE dis2.primaryDomainId IN ['mondo.0002025','mondo.0005090','mondo.0005485','mondo.0005487','mondo.0002028']
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName;

MATCH (ph:Phenotype)
WHERE toLower(ph.displayName) = toLower('Global developmental delay')
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName, ph.description AS phenotypeDescription, ph.dataSources AS phenotypeDataSources;

MATCH (ph:Phenotype)
WHERE toLower(ph.displayName) = toLower('Intellectual disability')
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName, ph.synonyms AS synonyms, ph.description AS description;

MATCH (d:Disorder)-[:DisorderHasPhenotype]->(ph:Phenotype)
WHERE ph.primaryDomainId IN ['hpo.0006829','hpo.0006852','hpo.0012389']
RETURN d.primaryDomainId AS disorderId, d.displayName AS disorderName;

MATCH (dis:Disorder)-[:DisorderHasPhenotype]->(ph1:Phenotype {primaryDomainId:'hpo.0004322'}), 
      (dis)-[:DisorderHasPhenotype]->(ph2:Phenotype {primaryDomainId:'hpo.0000252'})
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (s:Signature)
WHERE toLower(s.displayName) = toLower('Ig-like_fold')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName, s.dataSources AS originDatabase;

MATCH (p:Protein)-[:ProteinHasSignature]->(s:Signature)
WHERE toLower(s.displayName) = toLower('MHC_I/II-like_Ag-recog')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName;

MATCH (s:Signature)
WHERE toLower(s.displayName) CONTAINS 'mhc'
RETURN s.displayName AS signature, s.primaryDomainId AS id, split(s.primaryDomainId, '.')[0] AS database;

MATCH (go:GO)
WHERE toLower(go.displayName) = toLower('protein binding')
RETURN go.primaryDomainId AS goId, go.displayName AS goName, go.description AS description;

MATCH (go:GO)
WHERE toLower(go.displayName) = toLower('mitotic DNA replication initiation')
RETURN go.primaryDomainId AS goId, go.displayName, go.synonyms;

MATCH (p:Protein)
WHERE toLower(p.displayName) = toLower('EGFR')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, p.sequence AS aminoAcidSequence;

MATCH (p:Protein)-[:ProteinHasGOAnnotation]->(go:GO)
WHERE p.primaryDomainId IN ['uniprot.D5KL87','uniprot.A0A386YR42','uniprot.H6U5S5','uniprot.D5KL89','uniprot.Q761V2']
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, go.primaryDomainId AS goId, go.displayName AS goName;

MATCH (p:Protein)-[:ProteinEncodedByGene]->(g:Gene)
WHERE p.primaryDomainId IN ['uniprot.A7VN05','uniprot.A7VN06','uniprot.L0R6G1','uniprot.Q147T7','uniprot.F5H3Q6']
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (p:Protein)-[:ProteinEncodedByGene]->(g:Gene)
WHERE toLower(p.displayName) = toLower('EGFR')
RETURN g.primaryDomainId AS geneId, g.approvedSymbol AS approvedSymbol, g.chromosome AS chromosome;

MATCH (g:Gene)-[:GeneExpressedInTissue]->(t:Tissue)
WHERE toLower(g.displayName) = toLower('BRCA1')
RETURN t.primaryDomainId AS tissueId, t.displayName AS tissueName;

MATCH (g:Gene)-[:GeneExpressedInTissue]->(t:Tissue) 
WHERE toLower(t.displayName) = toLower('spleen') 
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (p:Pathway)
WHERE toLower(p.displayName) = toLower('Signal Transduction')
RETURN DISTINCT p.species AS species, p.taxid AS taxid, p.primaryDomainId AS pathwayId, p.displayName AS pathwayName;
